import React from 'react';
import {Button, Col, Container, Jumbotron, Row} from 'react-bootstrap'
import './App.css';

import NavigationBar from "./Components/NavigationBar";
import Welcome from "./Components/Welcome";

function App() {

    const marginTop = {
        marginTop : "20px"
    }

  return (
      <div className={"App"}>
        <NavigationBar/>
        <Container>

            <Row>
                <Col lg={12} style={marginTop}>
                    <Welcome/>
                </Col>
            </Row>
        </Container>
      </div>
  );
}

export default App;
